import React from 'react';
import styled, { keyframes } from 'styled-components';
import Nav from '../Nav/Nav';


const Home = () => {
    return (
        <Page>
            <Nav home={true}/>
            <Landing>
                <Logo className="logo">HUE STAGE</Logo>
            </Landing>
            <Animations>
                <Orb1/>
                <Orb2/>
            </Animations>
        </Page>
    );
};

export default Home;

let Landing = styled.div`
    color: white;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: rgba(0,0,0,0);
`

let Page = styled.div`
    background-color: rgba(0,0,0,0);
`


let Logo = styled.h2`
    padding-top: 400px;
    font-size: 4rem;
    letter-spacing: 0.8rem;
    z-index: 2;
    background-color: rgba(0,0,0,0);
`
let Animations = styled.div`
    position: fixed;
    width: 90vw;
    height: 90vh;
    z-index: 1;

`

let Orb1 = styled.div`
    position: absolute;
    border-radius: 50%;
    height: 100px;
    width: 100px;
    box-shadow: 0 0 150px 150px deeppink;
    overflow: hidden;
    background-color: deeppink;
`

let Orb2 = styled.div`
    position: absolute;
    border-radius: 50%;
    right: 0px;
    height: 100px;
    width: 100px;
    box-shadow: 0 0 100px 200px cyan;
    overflow: hidden;
    background-color: cyan;
`
